import React from "react";

function Login(props) {
    const [formData, setFormData] = React.useState({
        email: '',
        password: ''
    });

    function handleChange(evt) {
        const {name, value} = evt.target;
        setFormData({
            ...formData,
            [name]: value
        })
    }


    return(
        <div className="login">
            <p className="login__entry">Вход</p>
            <form className="login__form" onSubmit={handleSubmit}>
                <input onChange= {handleChange} name="email" type="email" placeholder="Email" className="login__input"></input>
                <input onChange={handleChange} name="password" type="password" placeholder="Пароль" className="login__input"></input>
                <button className="login__button" type="submit" onSubmit={handleSubmit}>Войти</button>
            </form>
        </div>
    )
}

export default Login;
